INSERT INTO `contact` VALUES (11,'Jim Fagan','jhfagan@mindspring.com','','ITS THE BUTTERMAN!','2009-07-17 23:01:50'),(40,'Don Schindler','drjs@lycos.com','http://arcticvision.wordpress.com/','Hey Ben!\r\nI was that guy from Alaska on the seat next to you on the flight back from Charlotte...\r\nNice site...and thanks for the encouragement.  Don\'t forget to see an acupuncturist for your ear trouble.\r\n\r\nDON','2009-10-10 19:00:24'),(87,'Elysa Boffo','eboffo@pa.net','','Can you tell me how to get the clock on my VCR to stop blinking?  I\'m so happy for you, Ben in your new job, new location and newlyish married life!!!!  Buona fortuna.','2010-04-19 04:12:14'),(90,'Zack Isaacson','zack@rivierapartners.com','www.rivierapartners.com','I just left you a voice mail but wanted to follow up. I am a technical recruiter that works with a lot of the VC backed startups in the Bay Area  and your background is impressive. \r\n\r\nI wanted to see if you had a few minutes to speak -- to network or discuss potential opportunities. You can get a better idea of what we do on our website as well (http://www.rivierapartners.com/sitedocs/site/Clients.php)\r\n\r\nI look forward to hearing from you.\r\n\r\nRegards,\r\nZack Isaacson\r\nSr Technical Recruiter \r\nRiviera Partners\r\n650.587.3566','2010-05-18 16:10:47'),(201,'Dave','dave.rice@gmail.com','','http://imgur.com/y7Hm9?full','2011-04-19 23:42:07'),(153,'Jesse Gortarez','jgortarez@gmail.com','','Hi Benjamin, \r\n\r\nI am a staffing consultant for several companies in the Bay Area. Three of these companies (Sencha, Tagged, Shutterfly)are all searching for engineers with your background. Your JavaScript (ExtJS) knowledge is needed for several openings at Sencha. While Shutterfly and Tagged are interested in strong front end developers. \r\n\r\nIf you have an interest in exploring any of these openings further, let me know what kind of information I can provide. \r\n\r\nThanks, \r\nJesse\r\nStaffing Consultant\r\n805.234.7454','2011-02-02 05:08:58'),(160,'Ivy','ivy.cao2011@gmail.com','','Hi Benjamin,\r\nYour profile is so good. If you\'re looking for a job. Please sent your CV to me. I\'ll contact for details. Thanks \r\n\r\n- Ivy Cao','2011-02-23 02:20:43'),(225,'DAVID GUISE','d.guise@carolinabank.com','','Where are you, Chach?','2011-07-25 18:12:24'),(255,'Jim Fagan','jhfagan@mindspring.com','','Hey, Highway!\r\nHope things are good.\r\nJust requesting cancelling the LINUX word of the day. \r\n\r\nKeep in touch w/me on Facebook.\r\nfacebook.com/hamerguitars.\r\n\r\n\r\nJim','2014-08-11 17:57:31'),(239,'Sylvie Picard','spicard@toryvel.com','','Please delete my e-mail address from your list of distribution of the Italian WOTD (word of the Day). Thank you.','2011-10-04 13:44:21');
