INSERT INTO `site_pics` VALUES (1,'/images/the_catch.png','<p>This renowned photo captures <a href=\"http://en.wikipedia.org/wiki/The_Catch\" onclick=\"this.target=\'_blank\';\" onfocus=\"if(this.blur)this.blur();\">The Catch</a>, arguably the best defensive play in baseball history. Willie Mays\' famous basket catch occurred during the 1954 World Series in Game 1 at the Polo Grounds in New York City, which the Giants would go on to win by sweeping the Cleveland Indians.</p>\r\n  <p><strong>benjamintoll.com</strong> is used to making game-winning, Series-ending basket catches by creating business solutions that are intuitive and user-friendly.</p>\r\n  <p>And I also really like the photo...</p>'),(2,'/images/im_smiling.jpg','<p>Zoe Madeleine Toll was born in Boston, MA, on December 26, 2005, to my brother Bill and his wife Amber.</p>\r\n  <p>This is how Red Sox Nation is built, one baby at a time.  Unless, of course, she grows up to be a Phillies fan like her <a href=\"/images/ben_zoe.jpg\" onclick=\"this.target=\'_blank\';\" onfocus=\"if(this.blur)this.blur();\">proud uncle</a>.</p>');
